import { Box } from '@mui/material';

const App = () => (
  <BrowserRouter>
    <Box sx={{ backgroundColor: '#000' }}>
      Navbar
      <Routes>
        <Route path="/" exact element={ <Feed />} />
      </Routes>
    </Box>
  </BrowserRouter>
);

export default App;
